import React from 'react';

import Dark from './Dark'

import theme from './theme';
import Profile from './Profile';
import {ThemeProvider} from '@mui/material/styles';



function App() {
  return (

      <ThemeProvider theme={theme}>
        <Profile/>
        <Dark/>

      </ThemeProvider>

  )
}

export default App
